void printRed(HANDLE hConsole, const char* text) {
    SetConsoleTextAttribute(hConsole, FOREGROUND_RED);
    printf(text);
    SetConsoleTextAttribute(hConsole, FOREGROUND_RED | FOREGROUND_BLUE | FOREGROUND_GREEN);
}

void printGreen(HANDLE hConsole, const char* text) {
    SetConsoleTextAttribute(hConsole, FOREGROUND_GREEN);
    printf(text);
    SetConsoleTextAttribute(hConsole, FOREGROUND_RED | FOREGROUND_BLUE | FOREGROUND_GREEN);
}

void printInfo(HANDLE hConsole, const char* pvtKey) {
    system("cls");
    printGreen(hConsole, title);
    printf("\n\n\n\n                                          ");
    printRed(hConsole, pvtKey);
    printGreen(hConsole, "\n\n\n\n\n\n\n                                            found: ");
    printf("0");
    printGreen(hConsole, "                              credit: ");
    printf("0$");
}
